An indie title from Santa Ragione, this game focuses on exploration in a surreal space setting. The game comes DRM-free, so there's no crack, just run the exe.

I'd recommend buying the game, it's only $10 through the Humble checkout and comes with a Steam key and future updates and platforms. 
